  `content` longtext COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ext_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ext_content_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `verifier_id` bigint(20) unsigned DEFAULT NULL,
  `verified_at` timestamp NULL DEFAULT NULL,
  `published` tinyint(1) NOT NULL DEFAULT 1,
  `comments_mode_id` int(10) unsigned NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `responses_activity_id_foreign` (`activity_id`),
  KEY `responses_user_id_foreign` (`user_id`),
  KEY `responses_verifier_id_foreign` (`verifier_id`),
  CONSTRAINT `responses_activity_id_foreign` FOREIGN KEY (`activity_id`) REFERENCES `activities` (`id`) ON DELETE CASCADE,
  CONSTRAINT `responses_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `responses_verifier_id_foreign` FOREIGN KEY (`verifier_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=464 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
